import { useSelector } from "react-redux";

function Header() {
    const tableHeadings = Object.keys(useSelector(state=>state.table)[0]).filter(val=>val!="id");

  return (
    <thead>
      <tr>
        {tableHeadings.map((val,i) => <th key={i}>{val}</th>)}
        {/* <th>name</th> */}
        {/* <th>age</th> */}
      </tr>
    </thead>
  );
}

export default Header;
